generated.css:
.axis text {
  font-family: 'Open Sans', sans-serif;
  font-size: 20pt;
}
.axis .label {
  font-size: 20pt;
}

.axis path, .axis line {
  fill: none;
  stroke: #000;
  shape-rendering: crispEdges;
}

.x.axis text {
  font-size: 20pt;
}

div.tooltip {	
  position: absolute;			
  text-align: center;			
  width: 100px;					
  height: 50px;					
  padding: 2px;				
  font: 16px sans-serif;		
  background: lightsteelblue;	
  border: 0px;		
  border-radius: 8px;			
  pointer-events: none;			
}
